script: |
  super -f text -I q9660.spq | sort > q9660.out

inputs:
  - name: q9660.spq
    data: |
      SELECT DISTINCT - col1 * - col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NOT + 20 / + + col2 BETWEEN NULL AND + ( + - col1 ) / + 35 - - col2 - - col0 );
  - name: tab0

outputs:
  - name: q9660.out
    data: |
